<!DOCTYPE html>
<html>
<head>
    <meta charset="utf-8">
    <meta name="viewport" content="width=device-width,initial-scale=1,minimum-scale=1,maximum-scale=1,user-scalable=no" />
    <title>批量管理解析</title>
    <style type=text/css>
        body {
            margin: 0 0px 0 0px;
            padding: 0 0px 0 0px;
            font-family: "Microsoft YaHei","宋体","Segoe UI", "Lucida Grande", Helvetica, Arial,sans-serif, FreeSans, Arimo;
        }
        /*顶部父元素*/
        .fung {
            z-index:999;
            position: fixed;
            background-color: white;
            padding: 2px 0 2px 10px;
            width:100%;
            top:0;
        }
        /*顶部按钮*/
        .butt a button{
            background-color: rgba(245, 245, 245, 0.6);
            border:insert;
            border-radius:7px;
            border-width:2.5px;
            border-color:rgba(0, 191, 255, 0.6);
            font-size:18px;
        }
        #div2{
           margin-top:22px;
        }
        /*父元素*/
        div.box {
            height: 40px;
            position: relative;
            width:96%;
            margin-left:2%;
        }
        form {
            position: relative;
        }
        /*列表*/
        .lab label {
            width: 100%;
            height: 38px;
            text-align:center;
            line-height:40px;
            white-space: nowrap;
            overflow: hidden;
            text-overflow: ellipsis;
            position: absolute;
            top: 0;
        }
        /*上阴影*/
        .lab label {
            border-radius: 4px;
            box-shadow: 0 5px 20px -5px #00BFFF inset;

        }
        /*下阴影*/
        .lab{
            border-radius: 4px;
            margin:5px auto;
            height:38px;
            width:100%;
            box-shadow: 0 -5px 20px -5px #00BFFF inset;
        }
        /*勾选*/
        input{
            height: 18px;
            width: 18px;
        }
        .box input {
            top:7px;
            right:1px;
            cursor: pointer;
            position: absolute;
        }
    </style>
</head>

<body>
    <div class="fung">
        <div class="butt" style="width:95%;">
            <a style="float:right;">
                <label style="float:left;border:none;height:28px;width:38px;background: url(https://static01.imgkr.com/temp/a87d43bcdd9f43d39fe372c53d2e51f7.png) no-repeat 10px 8px/20px 20px;" onclick="refreshPage();">
                </label>
                <button style="width: auto;color: grey;">全选
                    <input type="checkbox" onclick="changeState(this.checked)">
                </button>
            </a>
            <a style="float:left;">
                <button  style="width: 65px;color: rgba(227, 23, 13, 0.7);" onclick="deleteKey();">删 除
                </button>
            </a>
            <a style="margin-left:10px;">
                <button  style="width: 65px;color: rgba(0, 128, 0, 0.7);" onclick="exportText();">导 出
                </button>
            </a>
        </div>
    </div>
    <br>
    <div id="div2"></div>
</body>
